INSERT INTO `v1_9a1c675bcbea47f438fdd7f1a21769644da54590f5690cf74ec1bba584919fb1` VALUES ("ツムギのボトルキャップ", 1, 0.75, 11601, 0.625, 6, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。");
